const { default: Navbar } = require("./Navbar");
import Head from "next/head";

function Layout(props) {
  return (
    <div>
      <Head>
        <title>Bitprize</title>
      </Head>
      <Navbar />
      {props.children}
    </div>
  );
}

export default Layout;
